import React from "react";
import axios from "axios";
import Link from "next/link";

class Index extends React.Component {
  static async getInitialProps() {
    var promise = axios
      .get("http://localhost:4000/mainitems")
      .then(response => {
        return {
          hasErrored: false,
          mainitemData: response.data
        };
      })
      .catch(error => {
        return {
          hasErrored: true,
          message: error.message
        };
      });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      mainitemData: props.mainitemData
    };
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
      <div className="container dwi-div dwi-card">
        <div className="row">
          <div className="card-deck">
            <div className="card col-4 cardmin margintopbottom">
              <ul>
                {this.state.mainitemData.map(mainitem => (
                  <li key={mainitem.id}>
                    {mainitem.name} {mainitem.salePrice}{" "}
                    {mainitem.numberOfBottles}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Index;
